      .586
      .MODEL FLAT,STDCALL
      .STACK 4096
      option casemap :none  ; case sensitive

    include stars.inc		
    include blit.inc
    include rotate.inc	
    include game.inc

.DATA
myStr BYTE "Hello! Welcome to my EECS205 Game.",0
endStr BYTE "GAME OVER",0
scoreStr BYTE "Your score was:",0
t1 BYTE "Score: ",0
.CODE

;; Define the function GameRender
;; Since we have thoroughly covered defining functions in class, its up to you from here on out...

GameRender PROC
INVOKE BeginDraw

	;; start drawing things
	mov eax, offset bgSprites
	mov esi, 444
	add esi, eax ;max

d1:
	invoke BasicBlit, (Sprite PTR [eax]).bitmap, (Sprite PTR [eax]).location.x, (Sprite PTR [eax]).location.y
	cmp eax, esi
	jge s
	add eax, 12
	jmp d1
s:

	



	; which dragon? facing = 1 --> right, facing=0 --> left
	cmp facing, 1
	je fr
	mov charSprite.bitmap, OFFSET dragon0
	jmp done
	fr:
	mov charSprite.bitmap, OFFSET dragon1
	done:

	Invoke BasicBlit, charSprite.bitmap, charSprite.location.x, charSprite.location.y

	mov eax, OFFSET StarBitmap
	mov ebx, charX
	shl ebx, 10
	Invoke RotateBlit, eax, mouseX, mouseY, ebx

	; Invoke DrawString, 100, 20, OFFSET myStr
	; Invoke DrawInt, 100, 40, gState
	 ;draw  enemysprites
	 mov eax, offset enemySprites
	  mov esi, 28
	  add esi, eax ;max
 d2:
	 invoke BasicBlit, (AdvSprite PTR [eax]).bitmap, (AdvSprite PTR [eax]).location.x, (AdvSprite PTR [eax]).location.y
	
	 cmp eax, esi
	 jge s2
	 add eax, 28
	 jmp d2

 s2:
	
	mov eax, offset fireballs
	mov esi, 56
	add esi, eax ;max
d3:
	invoke BasicBlit, (AdvSprite PTR [eax]).bitmap, (AdvSprite PTR [eax]).location.x, (AdvSprite PTR [eax]).location.y
	cmp eax, esi
	jge s3
	add eax, 28
	jmp d3
s3:
	
	
	
	Invoke DrawString, 5, 20, OFFSET t1
	Invoke DrawInt, 80, 20, score
	
	cmp fxState, 1
	jne nxt2
	invoke BasicBlit, exp.bitmap, exp.location.x, exp.location.y
nxt2:
	
	cmp gState, 2
	jne nxt
	Invoke DrawString, 280, 200, OFFSET endStr
	Invoke DrawString, 240, 220, OFFSET scoreStr
	Invoke DrawInt, 370, 220, score
	mov eax, OFFSET explosion
	invoke BasicBlit, eax, charSprite.location.x, charSprite.location.y
nxt:
	

	
	
	;; end drawing thing
	INVOKE EndDraw
	ret

GameRender ENDP





